INSERT INTO `tiles`(`id`, `brand_id`, `img`, `images`, `name`, `description`, `cate`, `photos`, `created_at`, `updated_at`, `status`, `is_main`, `sort`, `type`) VALUES (25, 3, 'images/7d17031c65510b40db0e6473b96a99e8.jpg', '[\"images\\/f051c83ead7294c1255d417cee56cdc5.jpg\",\"images\\/dd08aeeb7347b7def717ec31d5e0407f.jpg\",\"images\\/90c3b8deb90f743ab20491bf3cfcfbe3.jpg\"]', '阿曼米黄', '马可波罗瓷砖是广东唯美陶瓷有限公司主打产品，总部位于现代制造业名城——东莞市，是国内规模最大的建筑陶瓷制造商和销售商之一。\r\n“马可波罗”品牌诞生于1996年，作为国内最早品牌化的建陶品牌，以“文化陶瓷”占领市场，享有“仿古砖至尊”的美誉。被中国陶瓷卫浴品牌网评选为2013年中国陶瓷十大品牌，是国内建陶产品系列最全的品牌。企业拥有380多项专利，其自主研发的原创设计──“中国印象”系列产品，将中国传统文化之精髓展现在瓷砖上，引导设计之风回归东方禅韵，受到国内外消费者和专家的广泛关注。', NULL, '[\"images\\/8f8e70e84417efb13af49acf4c707b1c.jpg\",\"images\\/aa0f93a1d1812175568a7bc8c8644fd7.png\",\"images\\/80f983d6a5cee7af3c9d09049f7ecac1.jpeg\"]', '2018-12-03 13:19:10', '2018-12-03 13:19:10', 1, 1, 100, 2);
